import Link from 'next/link';

import '../pages/Header.css';

const linkStyle = {
  marginLeft: 15
  
};

const Header = () => (
  <div className="MargRig">
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
  </div>
);

export default Header;
